function clearBrowsingData(){chrome.browsingData.remove({since:0},{cache:!0,cookies:!0,history:!0},(function(){chrome.notifications.create("",{type:"basic",iconUrl:"images/icon48.png",title:"Privacy Cleaner",message:"Browsing data cleared!"},(function(notificationId){setTimeout((function(){chrome.notifications.clear(notificationId)}),3e3)}))}))}chrome.commands.onCommand.addListener((function(command){"clear-browsing-data"===command&&clearBrowsingData()}));